import React, {Component} from 'react';
import EditExpense from '../edit-expense/edit-expense';



class ExpenseCondensed extends Component {
    
     constructor(props){
        super(props);
        this.editExpense = this.editExpense.bind(this);
        this.onButtonClicked = this.onButtonClicked.bind(this);           
    }

    editExpense = () => {
        <EditExpense expense={this.props.expense}/>
    }

    onButtonClicked = () =>{
       this.editExpense();         
    }
    
    
    render(){
        return(
            <li className="list-group-item expense-condensed">                        
            <p className="text-dark">{this.props.expense.title} | ${this.props.expense.cost}</p>
            <p className="text-dark">{this.props.expense.people}</p>
            <button className="btn btn-outline-danger text-dark" data-toggle="modal" data-target="#exampleModal">Edit</button>
            <div class="modal fade" id="exampleModal" tabindex="-1" role="dialog" aria-labelledby="exampleModalLabel" aria-hidden="true">
                <div class="modal-dialog" role="document">
                    <div class="modal-content">
                    <div class="modal-header">
                        <h5 class="modal-title" id="exampleModalLabel">Modal title</h5>
                        <button type="button" class="close" data-dismiss="modal" aria-label="Close">
                        <span aria-hidden="true">&times;</span>
                        </button>
                    </div>
                    <div class="modal-body">
                        ...
                    </div>
                    <div class="modal-footer">
                        <button type="button" class="btn btn-secondary" data-dismiss="modal">Close</button>
                        <button type="button" class="btn btn-primary">Save changes</button>
                    </div>
                    </div>
                </div>
                </div>
        </li>     
        )
    }
}

export default ExpenseCondensed;
